con:config.script:
import groovy.json.JsonSlurper;
import java.util.List;
import java.util.Map;

def groovyUtils = new com.eviware.soapui.support.GroovyUtils( context )
def json = testRunner.testCase.testSteps["Request 1"].testRequest.response.contentAsString
def data = new JsonSlurper().parseText( json )
//Assert JSON response objects
assert data.img
assert data.application
assert data.grid
assert data.id
assert data.level
assert data.message
assert data.time

//Assert that "time" contains nummbers only
def time = data.time[1].toString()
if (time.isNumber()) {
		assert true
} else {
	assert false
}

